mid=0
ind=0

for combination in "${combinations[@]}"
do
	echo $combination
	num=$(./a.out $combination | wc -l)
	if [ $num -le 5500 ]
	then
		echo -e "\e[34m$num\e[0m"
	else
		echo -e "\e[31m$num\e[0m" 
	fi

	res=$(./a.out $combination | ./checker_linux $combination)
	if [ "$res" == "OK" ]
	then
		echo -e "\e[32m$res\e[0m"  # prints in green
	else
		echo -e "\e[31m$res\e[0m"  # prints in red
	fi
	echo ""

	ind=$ind+1
	mid=$mid+$num
done

echo "score => $((mid / ind))"

